import React from 'react'
import { Button } from 'bootstrap'

export const Top_nav = () => {
  return (
    <div>
      <Button variant="contained" href='/services' className='services_button_left' style={{ backgroundColor: "rgb(2, 179, 55)", fontSize: "1vw", width: "7%" }}>
          Services
        </Button>


    </div>
  )
}
